import AdminHeader from '../components/layouts/admin.header';
import AdminSideBar from '../components/layouts/admin.sidebar';
import AdminFooter from '../components/layouts/admin.footer';

const Home = () => (
  <div>
    <AdminHeader />
    <AdminSideBar />
    <div className="content-wrapper">
      <h1>Admin</h1>
    </div>
    <AdminFooter/>
  </div>
)

export default Home
